    def flatten(items, prefix=''):
        flat_dict = {}
        for key, value in items.items():
            new_key = f"{prefix}{delimiter}{key}" if prefix else key
            if isinstance(value, dict):
                flat_dict.update(flatten(value, new_key))
            else:
                flat_dict[new_key] = value
        return flat_dict

    return flatten(obj)

